function About(){
    return(
        <div className='about'>
            <h2> About Us</h2>
            <div>
                <img src="" alt=" "/>
            </div>
            <div>
                <p>We have member tools which will enable<br/> your Sacco Member to save, borrow and <br/> repay through their mobile phones. </p>
                <br/>
                <h3> Our Core Values Are:</h3>
                <p> <img src="" alt=" trust"/> Trust </p>
                <p> <img src="/" alt=" "/> Quality </p>
                <p> <img src="" alt=" "/> Efficiency </p>
            </div>
        </div>
    );
};
export default About
